import React from 'react';

const CrowdMonitor = () => {
    return (
        <section id="crowdMonitor" className="py-20 bg-neutral-800">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                <div className="text-center mb-16 animate__animated animate__fadeIn">
                    <h2 className="text-4xl font-bold text-white mb-4">Crowd Monitoring</h2>
                    <p className="text-gray-400 text-lg">Stay informed about crowd levels at popular destinations.</p>
                </div>

                <div className="grid lg:grid-cols-2 gap-12">
                    {/* Content for crowd monitoring features will go here */}
                </div>
            </div>
        </section>
    );
};

export default CrowdMonitor;
